import React from "react";
import { Form, Button } from "react-bootstrap";
function Login() {
  return (
    <div>
      <h1 className="text-center mt-5">Login Here</h1>
      <Form style={{ width: "30%" }} className="m-auto mt-3">
        <Form.Group className="mb-3" controlId="formBasicEmail">
          <Form.Label>Email address</Form.Label>
          <Form.Control type="email" placeholder="Enter email" required />
        </Form.Group>

        <Form.Group className="mb-3" controlId="formBasicPassword">
          <Form.Label>Password</Form.Label>
          <Form.Control type="password" placeholder="Password" required />
        </Form.Group>
        <Button variant="primary" type="submit" className="d-flex m-auto">
          Submit
        </Button>
      </Form>
      <span className="d-flex flex-direction-column text-center">Don't have an account &nbsp;?</span>&nbsp;
      <a href="/signup">SignUp</a>
    </div>
  );
}

export default Login;
